$("#chatStream").click(function () {
    chat = "on";
    $("#chatframePlus").hide();
    $("#chatframeStream").show();
    $( "#videoEmbed" ).css({"margin":"","right":"","left":""});
    setAspectRatioSBP();
});

$("#chatOff").click(function () {
    chat = "off";
    $("#chatframeStream").hide();
    $("#chatframePlus").hide();
    $( "#videoEmbed" ).css({"margin":"0","right":"0px","left":"auto"});
    setAspectRatioSBP();
});


function checkImage (src, good, bad) {
    var img = new Image();
    img.onload = good; 
    img.onerror = bad;
    img.src = src;
}

function loadP1Gif(src) {
  var img = new Image();
  img.onload = function() {
      // code to set the src on success
      $("#p1gif").html('<img src="'+src+'" style="margin-left:auto;display: block;margin-right:auto;">');
  };
  img.onerror = function() {
    // doesn't exist or error loading
    ////console.log('Image: "'+src+'" doesn\'t exist');
  };

  img.src = src; // fires off loading of image
}

function loadP2Gif(src) {
  var img = new Image();
  img.onload = function() {
      // code to set the src on success
      $("#p2gif").html('<img src="'+src+'" style="margin-left:auto;display: block;margin-right:auto;">');
  };
  img.onerror = function() {
    // doesn't exist or error loading
    ////console.log('Image: "'+src+'" doesn\'t exist');
  };

  img.src = src; // fires off loading of image
}

function comma(nStr){
    nStr += '';
    var x = nStr.split('.');
    var x1 = x[0];
    var x2 = x.length > 1 ? '.' + x[1] : '';
    var rgx = /(\d+)(\d{3})/;
    while (rgx.test(x1)) {
        x1 = x1.replace(rgx, '$1' + ',' + '$2');
    }
    return x1 + x2;
}

function setAspectRatioSBP() {
        $('#videoEmbed').each(function() {
            $(this).width($(this).height()*(4/3) -32);
        });
        if( chat === "off"){
            $('#sbettorswrapper, #chatWrapper').css('width',(($('body').width()-$('#videoEmbed').width())));
        } else {
            $('#sbettorswrapper, #chatWrapper').css('width',(($('body').width()-$('#videoEmbed').width())/2));
        }
		if( localStorage['buttons'] == 1 ){
			$( "#p1name" ).css("width", ($('body').width()/3) - 155);
			$( "#p2name" ).css("width", ($('body').width()/3) - 155);
		} else {
			$( "#p1name" ).css("width", ($('body').width()/3) - 380);
			$( "#p2name" ).css("width", ($('body').width()/3) - 380);
		}
        //$('#sbettors1, #sbettors2').css('width',(($('#sbettorswrapper').width())/2) - 10);
		resizeText();
}

function resizeText(){

	if( pan != true ){
	  var maxfont = 32;
	} else {
	  var maxfont = 16;
	}
    
	$( '#p1name' ).css( 'font-size', maxfont );
	$( '#p2name' ).css( 'font-size', maxfont );
    $( '#player1wager' ).css( 'font-size', maxfont );
	$( '#player2wager' ).css( 'font-size', maxfont );
	
    var width = $( '#p1name' ).width(),
        html = '<span style="white-space:nowrap"></span>',
        line = $( '#p1name' ).wrapInner( html ).children()[ 0 ],
        n = maxfont
    $( '#p1name' ).css( 'font-size', n );

    while ( $( line ).width() > width ) {
        $( '#p1name' ).css( 'font-size', --n );
    }

    $( '#p1name' ).text( $( line ).text() );
	
	    var width = $( '#p2name' ).width(),
        html = '<span style="white-space:nowrap"></span>',
        line = $( '#p2name' ).wrapInner( html ).children()[ 0 ],
        n = maxfont
    $( '#p2name' ).css( 'font-size', n );

    while ( $( line ).width() > width ) {
        $( '#p2name' ).css( 'font-size', --n );
    }

    $( '#p2name' ).text( $( line ).text() );
	
	
	    var width = $( '#p1name' ).width(),
        html = '<span style="white-space:nowrap"></span>',
        line = $( '#player1wager' ).wrapInner( html ).children()[ 0 ],
        n = maxfont
    $( '#player1wager' ).css( 'font-size', n );

    while ( $( line ).width() > width ) {
        $( '#player1wager' ).css( 'font-size', --n );
    }

    $( '#player1wager' ).text( $( line ).text() );
	
	    var width = $( '#p2name' ).width(),
        html = '<span style="white-space:nowrap"></span>',
        line = $( '#player2wager' ).wrapInner( html ).children()[ 0 ],
        n = maxfont
    $( '#player2wager' ).css( 'font-size', n );

    while ( $( line ).width() > width ) {
        $( '#player2wager' ).css( 'font-size', --n );
    }

    $( '#player2wager' ).text( $( line ).text() );

}

